The key psychological mechanisms involved in responder behavior in this economic game are fairness and self-interest.  Responders likely consider the proposed split's fairness relative to their contribution (tokens_self) and the opponent's contribution (tokens_opp), and weigh that against the purely self-interested benefit of accepting the offer.  A purely self-interested responder would accept any positive offer.  However, individuals often exhibit a degree of fairness-seeking behavior, even at a personal cost, which means they might reject unfair offers.


How these mechanisms interact: The interaction between fairness and self-interest can be modeled as a weighted sum. The weight given to fairness depends on the individual's level of fairness concern. A high fairness concern will lead to a greater weight placed on fairness considerations, and vice versa. The fairness of an offer can be computed by taking the ratio of the proposer's share relative to their tokens gained versus the responder's.


What mathematical form could capture these interactions:  A simple linear model can capture these interactions. The utility of accepting an offer will be a function of the monetary gain (`split_self`) and a fairness term derived from the token ratio and split proportion.


What parameters would be needed to calibrate the model: Two parameters will be sufficient:

1.  `fairness_weight`:  This parameter reflects the individual's sensitivity to fairness, modulating the influence of the fairness term on the utility. This value will range from negative infinity to positive infinity, indicating the weight given to fairness, where positive values indicate a positive relationship with fairness.
2.  `self_interest_weight`: This parameter weights the monetary amount offered to the responder, reflecting the individual's level of self-interest.  This value will also range from negative infinity to positive infinity, indicating the weight given to self interest, where positive values indicate a positive relationship with the monetary amount offered.

How the model variables map to observable behavior: A higher `fairness_weight` will lead to a higher rejection rate of unfair offers. A higher `self_interest_weight` will increase the acceptance rate of all offers (even the unfair ones).


