def simulate_model(trial_data, self_interest_weight=1, fairness_weight=1):
    utility_values = []
    for trial in trial_data:
        try:
            split_self = trial['split_self']
            token_self = trial['token_self']
            split_opp = trial['split_opp']
            token_opp = trial['token_opp']

            #Handle potential division by zero
            if token_self == 0 or token_opp == 0:
                fairness_term = 0  # Or another appropriate handling like a large penalty
            else:
                fairness_term = (split_self / token_self) - (split_opp / token_opp)

            utility = (self_interest_weight * split_self) + (fairness_weight * fairness_term)
            utility_values.append(utility)
        except KeyError as e:
            print(f"Warning: Missing key '{e}' in trial data. Skipping this trial.")
            utility_values.append(None) # or handle the missing data in a different way


    return utility_values
